import React from 'react'
import { StyleSheet, Text, View } from 'react-native'
import { SvgXml } from "react-native-svg";

export default function IconClock() {
    const clock = `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="24" height="24">
                        <path fill="#000" d="M0 0h24v24H0z" /><path d="M12 22C6.477 22 2 17.523 2 12S6.477 2 12 2s10 4.477 10 10-4.477 10-10 10zm0-2a8 8 0 1 0 0-16 8 8 0 0 0 0 16zm1-8h4v2h-6V7h2v5z" /></svg>`
    const Icon = () => <SvgXml xml={clock} width='24px' height='24px'/>          
    return <Icon></Icon>
}

const styles = StyleSheet.create({})
